import React from 'react';
import "./BottomFooter.css";

const BottomFooter = () => {
  return (
    <div className="watchlistdisplay-tvshow">
      <div className="picture1">
        <img className="joker-icon2" alt="" src="/joker@2x.png" />
      </div>
      <div className="right3">
        <div className="sublayout3">
          <div className="title8">How I Met Your Mother</div>
          <div className="season1">Season 5</div>
          <div className="rating7">
            <div className="xy103">x.y/10</div>
            <img className="vector-icon16" alt="" src="/vector2.svg" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default BottomFooter;
